description:
Cette couche est une sauvegarde de l'ancienne couche du référentiel bâtiments sur Rennes Métropole à une date donnée.  
Son mode de constitution et de mise à jour a été le suivant :  
=> Sur le territoire de la Ville de Rennes, les bâtiments ont été numérisés sur la base de prises de vues aériennes au début des années 2000. Ils ont depuis été mis à jour sur la base des permis de construire (numérisation des volumes en 3D sur la base de plans masses) si la déclaration d'ouverture de chantier associée était transmise à Rennes Métropole. Les dernières saisies opérées par le biais de cette méthode, datent du début de l'année 2023.  
=> Sur les autres communes de la Métropole, la création (en 2012) et la mise à jour (tous les 3 ans environ) des bâtiments étaient opérées à partir de photographies aériennes verticales et obliques. La dernière mise à jour a été opérée sur des clichés pris durant les étés 2017-2018.   
Parmi les attributs disponibles :  
\- id_rm : identifiant Rennes Métropole du bâtiment ;  
\- code_insee : code insee de la commune d'appartenance du bâtiment ;  
\- type_bati : type de bâtiment (renseigné principalement sur Rennes) ;  
\- zmin : altitude la plus basse du bâtiment au sol (cote issue d'un modèle numérique de terrain récent) ;  
\- zmax : altitude la plus élevée du faîtage du bâtiment.  
Cette couche est en cours de refonte complète, d’où son statut "Archivé". Une autre couche de données nommée Référentiel bâtiment sur Rennes Métropole et décrite par la métadonnée UUID = 8cf92d81-1085-495f-9d64-033ec307193b est en cours de création pour la remplacer.   
Cette refonte s'avère nécessaire du fait de problèmes de géométrie qui complexifient considérablement l'utilisation de ces bâtiments.  
A noter que, dans le cadre de la refonte, l'identifiant bâtiment de cette couche (id_rm) ne sera probablement pas pérenne.
